On a new line below the url variable (but still before fetchGifByOrderName's closing }), let's type out the native fetch structure with some comments & console.logs:
fetch(url) // URL of API
   .then(function(response) {
       // Code for processing data response from API to desired data format
       return response.json();
   })
 .then(function(response) {
   // Code for using the data we formatted
       console.log(response);
 })
 .catch(function(error) {
   // Code to run if API returns an error
 console.log(error);
 });
